'''United States Coast Guard Station Washington''' is a [[United States Coast Guard]] station located on [[Joint Base Anacostia-Bolling]] in [[Washington, D.C.]] The station was commissioned on September 23, 2003.<ref>{{cite web |url=http://coastguard.dodlive.mil/2009/10/station-washington-guarding-the-national-capital-region/ |first=Connie |last=Braesch |title=Station Washington – Guarding the National Capital Region |work=Coast Guard Compass: Official Blog of the U.S. Coast Guard |date=October 20, 2009 |accessdate=November 12, 2011}}</ref>
